import React from 'react'
import Navbar from '../molecules/NavBar'
import FooterArtApi from '../molecules/FooterArtApi'
import { Box, styled } from '@mui/material'

interface IBasicTemplate {
    handleSearchResult: any;
    handleSearch: any;
    middleData: React.ReactNode;
}

const NavBarBox = styled(Box)({
  marginBottom : "32px",
});


const BasicTemplate = ({handleSearchResult,handleSearch, middleData, searchImage}: IBasicTemplate) => {
  return (
    <Box>
        <NavBarBox>
        <Navbar handleSearchResult={handleSearchResult} handleSearch={handleSearch} searchImage={searchImage}/>
        </NavBarBox>
        <Box>
            {middleData}
        </Box>
        <FooterArtApi/>
    </Box>
  )
}

export default BasicTemplate
